import React from 'react';
import CharacterCard from './CharacterCard';

const CharacterList = (props) => {
  debugger;
  console.log(props);
  const errorSearch = props.filteredItems.length === 0 ? <p>{`No hay ningún personaje que coincida con${props.search}`} </p> : '';

  return (
    <>
      {errorSearch}
      <ul className='list'>
        <CharacterCard filteredItems={props.filteredItems} />
      </ul>
    </>
  );
};

export default CharacterList;
